import axios from 'axios'
import React, { useEffect,useState } from 'react'

const AllProducts = () => {
    const [data, setData] = useState([]);
    async function getallpro() {
        try {
          let res = await axios.get("http://127.0.0.1:1214/api/products/users");
          console.log(res)
        } catch (error) {
          console.log(error);
        }
      }
      useEffect(() => {
        getallpro();
      }, []);
  return (
    <>
       
      <table cellPadding={10} className="table table-hover container mt-5 ">
        <tr>
          
          <th>Name</th>
          <th>Price</th>
          <th>Category</th>
          <th>Instock</th>
        </tr>
        {
            data.length==0 ? (<h1>No record found</h1>)
            :
            (data.map(x=>{
                <tr>
                <td>{x.Name} </td>
                <td>{x.Price} </td>
                <td>{x.Category} </td>
                <td>{x.Instock} </td>
                {/* <td>{x.Phone} </td> */}
                {/* <button  className="btn btn-danger"  onClick={()=>Delete(x._id)}> Delete </button>
                <button className="btn btn-success my-2" > Edit </button> */}
              </tr>
            }))
        }
      </table>
  
    </>
  )
}

export default AllProducts
